import React, { Component } from "react";
import { MDBBtn, MDBCol, MDBContainer, MDBRow} from "mdbreact";
import "./index.css";
import logo from "./logo.png";

class App extends React.Component {
   render() {
      return (
         <div>
            <Header/>

         </div>
      );
   }
}
class Header extends React.Component {
   render() {
      return (
         <div>
            <div class="bg">
              <div class="container">
                <div class="row">
                  <div align="right" class="col-lg-12 mt-3">
                    <div class="site-heading">
                      <p><a href="#" class="signin-link header-login-button ui button mr0" id="signin-link">Masuk</a></p>
                      <p><a href="#" class="signup-link header-login-button ui button mr0" id="signup-link">Buat akun</a></p>
                    </div>
                  </div>
                </div>
              </div>
            </div>
         </div>
      );
   }
}
class Content extends React.Component {
   render() {
      return (
         <div>
            <h2>Content</h2>
            <p>The content text!!!</p>
         </div>
      );
   }
}
export default App;
